function test(i){
    var i2 = parseInt(i) + 1;
    var i3 = parseInt(i) - 1;

    console.log(i);
    for(var a = 1; a < i2; a++){
        var url2 = url + "page-" + a;
        $.get(url2, function(data2){  
            var aCh = $(data2);
            Curr_page = aCh.find('a.currentPage:first').text();
            console.log(Curr_page);
            content += '<li id="'+Curr_page+'" dn='+addZeros(Curr_page)+'>Page '+ Curr_page + '<ul>';
            $('body').empty();
            $('body').append("Loading Page "+ postcount +" out of " + i2 +" Page(s)...");
            $(aCh).find("[id^=post] div.messageInfo.primaryContent > div.messageContent > article > blockquote").each(function(e) {

                content += '<li class="post">'+$(this).html()+'</li>';

            });
            content2 += '<li id="'+Curr_page+'" dn='+addZeros(Curr_page)+'>Page '+ Curr_page + '<ul>';
            $(aCh).find('td.ctaBbcodeTableCellLeft').each(function(e) {
                if ($(this).length !== 0){

                    content2 += '<li class="post2">'+$(this).html()+'</li>';
                }
            });
            content += '</ul></li>';
            content2 += '</ul></li>';
            if(postcount === i3){
                content += '</ul>';
                content2 += '</ul>';
                view_pages();
            }
            postcount++;
        });

    }

}




